import React, { Component } from 'react'
import UtilisateurCommentaire from './UtilisateurCommentaire'
import HeaderAccueil from './HeaderAccueil'
import logo from "./logo.png"

class Utilisateur extends Component {
    constructor(props) {
        super(props);
        this.main = this.main.bind(this)
        this.inscription = this.inscription.bind(this)
        this.connexion = this.connexion.bind(this)
    }

    main() {
        this.props.changePage('main')
    }

    inscription() {
        this.props.changePage('inscription');
    }

    connexion() {
        this.props.changePage('connexion');
    }

    render() {
        return (
            <div>
                <HeaderAccueil changePage={this.props.changePage} />
                <div className="corps">
                    <span className="liste_contacts">
                        <h3> Liste des contacts </h3>
                        <ul>
                            <li><a>billyBOB</a></li>
                            <br/>
                            <li><a>secretAgent007</a></li>
                            <br/>
                            <li><a>palmashowUltimate3000</a></li>
                            <br/>
                            <li><a>jackyJones123</a></li>
                            <br/>
                            <li><a>charlotteMaisPasAuxFraises</a></li>
                        </ul>
                    </span>
                    <span className="profil">
                        <div class="titre_page">
                            <h1>Profil de filanteetoile</h1>
                            <button id="ajout_contact">Ajouter en contact</button>
                        </div>
                    </span>
                </div>
                <UtilisateurCommentaire/>
            </div>
        );
    }
}

export default Utilisateur;
